  const value = {'editorState':{'root':{'children':[{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'黄初三年，余朝京师，还济洛川。古人有言，斯水之神，名曰宓妃。感宋玉对楚王神女之事，遂作斯赋。其辞曰：','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'tag':'h1','type':'heading','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'余从京域，言归东藩。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'背伊阙，越轘辕，经通谷，陵景山。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'日既西倾，车殆马烦。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'尔迺税驾乎蘅皋，秣驷乎芝田，容与乎阳林，流眄乎洛川。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'于是精移神骇，忽焉思散，俯则未察，仰以殊观，睹一丽人，于岩之畔。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'迺援御者而告之曰：','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'尔有觌于彼者乎？彼何人斯？若此之艳也？','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'御者对曰：','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'臣闻河洛之神，名曰宓妃。然则君王所见，无迺是乎？其状若何？臣愿闻之。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'余告之曰：','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'其形也，','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'翩若惊鸿，婉若游龙。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'荣曜秋菊，华茂春松。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'仿佛兮若轻云之蔽月，飘飖兮若流风之回雪。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'远而望之，皎若太阳升朝霞；','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'迫而察之，灼若芙蕖出渌波。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'襛纤得衷，脩短合度。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'肩若削成，腰如约素。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'延颈秀项，皓质呈露。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'芳泽无加，铅华弗御。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'云髻峨峨，脩眉联娟。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'丹唇外朗，皓齿内鲜。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'明眸善睐，靥辅承权。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'瑰姿艳逸，仪静体闲。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'柔情绰态，媚于语言。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'奇服旷世，骨像应图。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'披罗衣之璀粲兮，珥瑶碧之华琚。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'戴金翠之首饰，缀明珠以耀躯。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'践远游之文履，曳雾绡之轻裾。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'微幽兰之芳蔼兮，步踟蹰于山隅。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'于是忽焉纵体，以遨以嬉。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'左倚采旄，右荫桂旗。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'攘皓腕于神浒兮，采湍濑之玄芝。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'余情悦其淑美兮，心振荡而不怡。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'无良媒以接欢兮，托微波而通辞。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'愿诚素之先达兮，解玉佩以要之。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'嗟佳人之信脩兮，羌习礼而明诗。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'抗琼珶以和予兮，指潜渊而为期。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'执眷眷之款实兮，惧斯灵之我欺。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'感交甫之弃言兮，怅犹豫而狐疑。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'收和颜而静志兮，申礼防以自持。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'于是洛灵感焉，徙倚彷徨，','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'神光离合，乍阴乍阳。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'竦轻躯以鹤立，若将飞而未翔。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'践椒涂之郁烈，步蘅薄而流芳。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'超长吟以永慕兮，声哀厉而弥长。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'尔迺众灵杂遝，命俦啸侣，','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'或戏清流，或翔神渚，','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'或采明珠，或拾翠羽。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'从南湘之二妃，携汉滨之游女。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'叹匏瓜之无匹兮，咏牵牛之独处。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'扬轻袿之猗靡兮，翳脩袖以延伫。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'体迅飞凫，飘忽若神，','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'凌波微步，罗袜生尘。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'动无常则，若危若安。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'进止难期，若往若还。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'转眄流精，光润玉颜。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'含辞未吐，气若幽兰。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'华容婀娜，令我忘餐。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'于是屏翳收风，川后静波。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'冯夷鸣鼓，女娲清歌。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'腾文鱼以警乘，鸣玉鸾以偕逝。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'六龙俨其齐首，载云车之容裔。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'鲸鲵踊而夹毂，水禽翔而为卫。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'于是越北沚，过南冈，纡素领，回清阳。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'动朱唇以徐言，陈交接之大纲。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'恨人神之道殊兮，怨盛年之莫当。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'抗罗袂以掩涕兮，泪流襟之浪浪。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'悼良会之永绝兮，哀一逝而异乡。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'无微情以效爱兮，献江南之明珰。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'虽潜处于太阴，长寄心于君王。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'忽不悟其所舍，怅神宵而蔽光。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'于是背下陵高，足往神留，','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'遗情想像，顾望怀愁。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'冀灵体之复形，御轻舟而上溯。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'浮长川而忘反，思绵绵而增慕。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'夜耿耿而不寐，霑繁霜而至曙。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'命仆夫而就驾，吾将归乎东路。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1},{'children':[{'detail':0,'format':0,'mode':'normal','style':'','text':'揽𬴂辔以抗策，怅盘桓而不能去。','type':'text','version':1}],'direction':'ltr','format':'','indent':0,'type':'paragraph','version':1}],'direction':'ltr','format':'','indent':0,'type':'root','version':1}},'lastSaved':1690705398350,'source':'Playground','version':'0.11.3'}

